import React from 'react';

const VideoItem = ({ video, onUpVote, onDownVote, onDelete }) => {
  return (
    <div className="video-item">
      <h3>{video.title}</h3>
      <iframe width="560" height="315" src="https://www.youtube.com/embed/{VIDEO_ID_GOES_HERE}" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
      <p>Votes: {video.votes}</p>
      {/* <button onClick={() => onUpVote(video)}>Up Vote</button> */}
      <i onClick={() => onDownVote(video)} style={{ fontSize: '24px'}} className="fa">&#xf087;</i>
      {/* <button onClick={() => onDownVote(video)}>Down Vote</button> */}
      <i onClick={() => onDownVote(video)} style={{ fontSize: '24px' }} className="fa">&#xf088;</i>

      <button onClick={() => onDelete(video)}>Delete</button>
    </div>
  );
};

export default VideoItem;
